import { Link } from 'react-router-dom';
 import './index.css';
const Navbar = () => {

    return  (
        <header>
            <div children="container">
            <Link to="/">
                <h1>Workout Buddy</h1>
            </Link>
            </div>
        </header>
    )
};

export default Navbar;
